<?php

use PHPUnit\Framework\TestCase;
use Wzx2002\Upload\Impls\OssUploadImpl;
use Wzx2002\Upload\Upload;

class OssUploadTest extends TestCase
{
    private array $oss_config = [
        'accessKeyId' => 'LTAI5t7PuXPCfassXRsvYP6n',
        'accessKeySecret' => 'FOgMgSmh89uHSvrembfwrAwaz72SV6',
        'endpoint' => 'wzx2002.oss-cn-beijing.aliyuncs.com'
    ];


    public function testOssUpload()
    {
        $instance = Upload::getInstance()
            ->setUploadInstance(OssUploadImpl::getInstance());
        $instance->setConfig($this->oss_config);
        $instance->setBucket('wzx2002');

        $res = $instance->uploadMany(['data:image/webp;base64,',
            'data:image/jpeg;base64,']);

        print_r($res);

        $this->assertEquals(0, $res['errCode']);
    }

    public function testMultiUploadFile()
    {
        $instance = Upload::getInstance()
            ->setUploadInstance(OssUploadImpl::getInstance());
        $instance->setConfig($this->oss_config);
        $instance->setBucket('wzx2002');
        $res = $instance->multiUploadFile(
            'https://img-blog.csdnimg.cn/20201211110345632.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3NhbGVzdGluYQ==,size_16,color_FFFFFF,t_70'
        );

        print_r($res);

        $this->assertEquals(0, $res['errCode']);
    }
}